import './App.css';
import {Button} from '@mui/material';

function App() {
  return (
    <div className="App">
      <h1>wecedMerced!</h1>

      <div className="form">
        <label>Username: </label>
        <input type="text" name="Username" />
        <label>Password: </label>
        <input type="text" name="Summary" />

        <Button className="Button">
          Submit
        </Button>

      </div>

    </div>
  );
}

export default App;
